export const Contact = () => {
    return (
        <section className="contact">
            <div className="container">
                <div className="left">
                    <div className="form-wrapper">
                        <ContactHeading />
                        <ContactForm />
                    </div>
                </div>
                <div className="right"></div>
            </div>
        </section>
    );
}

const ContactHeading = () => (
    <div className="contact-heading">
        <h1>Let's Work Together <span>.</span></h1>
        <p className="text">
            Or reach us via :
            <a href="mailto:owenbolling2@gmail.com">owenbolling2@gmail.com</a>
        </p>
    </div>
);

const ContactForm = () => (
    <form action="index.html" method="post" className="contact-form">
        <InputField
            type="text"
            name="FirstName"
            labelText="First Name"
            iconElement={<ion-icon name="mail-outline"></ion-icon>}
        />
        <InputField
            type="text"
            name="LastName"
            labelText="Last Name"
            iconElement={<ion-icon name="mail-outline"></ion-icon>}
        />
        <InputField
            type="email"
            name="Email"
            labelText="Email"
            iconElement={<ion-icon name="mail-outline"></ion-icon>}
        />
        <TextAreaField
            name="Message"
            labelText="Message"
            iconElement=<i class="fa-solid fa-envelope"></i>
        />
    </form>
);

const InputField = ({ type, name, labelText, iconClass }) => (
    <div className="input-wrap">
        <input
            type={type}
            className="contact-input"
            autoComplete="off"
            name={name}
            required
        />
        <label>{labelText}</label>
        <i className={iconClass}></i>
    </div>
);

const TextAreaField = ({ name, labelText, iconClass }) => (
    <div className="input-wrap textarea">
        <textarea 
            name={name} 
            autoComplete="off" 
            className="contact-input" 
            required 
        />
        <label>{labelText}</label>
        <i className={iconClass}></i>
    </div>
);
